(29378, 'E2C3A75F-72DC-4382-A330-5DFF945FF8BC', 'This note came in this morning and took my breath away.  Nitzan,  I don’t know if you’ve ever heard my story but I came from nothing in a little cotton town in the south . like dirt floor no heat in the winter  nothing, and I had pretty violent early years. I got my GED because I hated school and thought they were teaching me stuff I already knew (ohh to be young and know everything again lol) I pushed myself through my first degree in college.     After that I met a man that I was with for 7 years, who is still a dear part of my life. We traveled the world and had a great time. This man is an enterprise architect who has worked for the stock exchange and Facebook and the government and is just a super smart amazing person, but I would always watch him work and do deployments and think “man I wish I could do something like that but I’m not smart enough and the best I can do is get married and have babies and do hair and bartend on the side” (nothing wrong with getting married and having babies. That is just what is pushed on girls in the south ) that sparked my initial dream and interest in tech but I didn’t think I could make it a reality.       Flash forward to that relationship imploding and fate taking me to the bay and climb hire. I have met some wonderful people like my very best friends Vicky and Zohar and you and Alex and everyone else and gained a community for the first time. For the first time people believed that I could actually be something more than a pretty face to make your drink in the bar , and for the first time I know that I am smart enough to accomplish all of my dreams and help others along the way.       My climbers this cohort are amazing and intelligent entrepreneurs and people , and Zohar and I consider ourselves so lucky to have them.      Sorry for the long message , but I honestly am forever grateful to Climb Hire , and most importantly you for believing in us and giving all of us misfits a place where we can realize our potential and go on to live our dreams no matter what they may be. I am not sure if you are religious, but the Gods (Hindu here ) put it on my heart today to thank you and let you know what an impact you have made in my life , as well as many other lives, and how grateful myself and everyone else is to you and this program . If there is ever any way at all beyond fellowship I can help with CHs endeavors please let me know. ❤️', 'Nitzan', 'David', '2021-07-12T11:46:32.720041'),
(29379, 'C2DC62A8-215F-4D8E-83C9-0B5DCF652F55', 'I look forward to reading this...reacting to the Koch $.', 'David', 'Nitzan', '2021-07-12T12:03:30.292000'),
